// This KQL query was generated by AI:
// for each stock, get the average price over the past hour
//
StockMarket
| where todatetime(['time']) > ago(1h)
| summarize avgPrice=avg(todouble(lastSalePrice)) by symbol



// This KQL query was generated by AI:
// sum of stock sales for the past 30 minutes
//
StockMarket
| where todatetime(['time']) > ago(30m)
| summarize totalSales=sum(todouble(lastSaleSize))
